        :type s: str
        :rtype: List[str]
        """

        def isValid(s):
            cnt = 0
            for c in s:
                if c == '(':
                    cnt += 1
                elif c == ')':
                    if cnt > 0:
                        cnt -= 1
                    else:
                        return False
            return cnt == 0

